import './App.css';
import Login1 from './component/Login1';
import Login2 from './component/Login2';
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom';



function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/1" element={<Login1 />} />
          <Route path="/2" element={<Login2 />} />
        </Routes>

      </Router>
    </div>
  );
}

export default App;
